const Form = () => {
	return (

	<div>
		<h1>Get in Touch</h1>
		<p>Please fill out the quick form and we will be in touch with lightening speed.</p>
		<label for="email">Email</label>
		<input type="email" className="" name="email" placeholder="Your Email address" /><br/>
		<label for="feedback">Message</label>
		<input type="textarea" name="message" placeholder="Message" rows="8" cols="40" maxLength="200"/> <br />
		<input type="submit" name="Submit"/>
	</div>

		)
}

